// import React, { useEffect } from 'react'
import Carddata from './carddata'
import data from './data'

function Card(){
  // useEffect(()=>{
  //   alert("Welcome to my Anime World")
  // },[])
  document.body.style.backgroundColor="lightgrey"
  return (
    <div>
      <div style={{textAlign:"center",backgroundColor:"lightgray",color:"darkblue" ,display: "flex",flexwrap: "wrap",justifycontent: "center",}}>
      <br/><br/>
        <h1>Welcome to My Anime Page</h1><br/><br/>
      </div>
        {data.map((val)=>(
            <Carddata
                key={val.id}
                products={val}
            />
        ))}
    </div>
  )
}

export default Card
